import React from "react";
import { Navbar, NavbarBrand, Nav, NavItem, NavLink } from "reactstrap";
import { Link } from "react-router-dom";

import SignOutButton from "./SignOut";
import * as routes from "../constants/routes";

import AuthUserContext from "./AuthUserContext";

const Navigation = () => (
  <AuthUserContext.Consumer>
    {authUser =>
      authUser ? <NavigationAuth userInfo={authUser} /> : <NavigationNonAuth />
    }
  </AuthUserContext.Consumer>
);

const NavigationNonAuth = () => (
  <React.Fragment>
  <header class="cd-header">
			<div class="header-wrapper">
				<div class="logo-wrap">
					<a href="/" class="cursor-link animsition-link"><img
							src="https://ivang-design.com/alke/img/logo.png" alt="" /></a>
				</div>
				<div class="nav-but-wrap">
        <button onclick="myFunction()">Click me</button>
				</div>
			</div>
		</header>

		<div class="nav">
			<div class="nav__content">
				<ul class="nav__list">
					<li class="nav__list-item"><a data-toggle="collapse"
							href="https://ivang-design.com/alke/#collapseSub" class="cursor-link" role="button"
							aria-expanded="false" aria-controls="collapseSub">work</a>
						<ul class="sub-links collapse" id="collapseSub">
							<li><a href="https://ivang-design.com/alke/index.html"
									class="cursor-link animsition-link">case studies</a></li>
							<li><a href="https://ivang-design.com/alke/index-1.html"
									class="cursor-link animsition-link">hero slider</a></li>
							<li><a href="https://ivang-design.com/alke/index-2.html"
									class="cursor-link animsition-link">boring masonry</a></li>
							<li><a href="https://ivang-design.com/alke/index-3.html"
									class="cursor-link animsition-link">floating title</a></li>
							<li><a href="https://ivang-design.com/alke/index-4.html"
									class="cursor-link animsition-link">gallery version</a></li>
						</ul>
					</li>
					<li class="nav__list-item active-nav"><a href="https://ivang-design.com/alke/studio.html"
							class="cursor-link animsition-link">studio</a></li>
					<li class="nav__list-item"><a href="https://ivang-design.com/alke/blog.html"
							class="cursor-link animsition-link">news</a></li>
					<li class="nav__list-item"><a href="https://ivang-design.com/alke/contact.html"
							class="cursor-link animsition-link">contact</a></li>
				</ul>
			</div>
		</div>
    </React.Fragment>
);


export default Navigation;

const NavigationAuth = ({ userInfo }) => (

  <header class="cd-header">
    <div class="header-wrapper">
      <div class="logo-wrap">
        <Link to={routes.LANDING} ><img
          src="https://ivang-design.com/alke/img/logo@2x.png" alt="" /></Link>


      </div>
      <div class="nav-but-wrap">
        <div class="cursor-link animsition-link">
          <Link to={routes.HOME}>My Projects</Link>
          {userInfo.providerData[0].providerId === "facebook.com" ? null : (

            <Link to={routes.ACCOUNT}>Account</Link>

          )}
          <SignOutButton />
        </div>
      </div>
    </div>
  </header>





);

